pub struct BufferedParser {
    args: Args,
    state: Vec<u8>,
}
impl BufferedParser {
    pub fn new(args: Args) -> Self {
        Self {
            args,
            state: Vec::new(),
        }
    }

    pub fn feed_bytes(
        &mut self,
        packet: &[u8],
    ) -> Option<Result<InstructionFromTimingProgram, String>> {
        let header_res = check_nrbf_headers(&self.args, packet);
        let termination_res = check_nrbf_termination_bytes(packet);

        if let Some(body_data) = header_res {
            if termination_res {
                // self contained packet (never copy)
                return Some(decode_single_nrbf(&self.args, body_data));
            } else {
                self.state.extend_from_slice(body_data);
            }
        } else {
            // append full packet
            self.state.extend_from_slice(packet);

            if termination_res {
                // packet ended
                let res = decode_single_nrbf(&self.args, &self.state);

                // clear internal buffer
                self.state.clear();

                return Some(res);
            }
        }

        // Missing data
        None
    }

    pub fn feed_bytes_return_owned_on_fail(
        &mut self,
        packet: &[u8],
    ) -> Option<Result<InstructionFromTimingProgram, (String, Vec<u8>)>> {
        let header_res = check_nrbf_headers(&self.args, packet);
        let termination_res = check_nrbf_termination_bytes(packet);

        if let Some(body_data) = header_res {
            if termination_res {
                // self contained packet (never copy)
                return Some(
                    decode_single_nrbf(&self.args, body_data).map_err(|err| (err, packet.into())),
                );
            } else {
                self.state.extend_from_slice(packet); // this version KEEPS the header stored (as it needs to return it possibly)
            }
        } else {
            // append full packet
            self.state.extend_from_slice(packet);

            if termination_res {
                // packet ended
                // slice out header bytes here
                let res =
                    decode_single_nrbf(&self.args, &self.state[HEADER_BYTES_TEMPLATE.len()..]);

                let copy = std::mem::take(&mut self.state);
                self.state.clear(); // should not do anything now, as the operation above replaced the vec with default

                return Some(res.map_err(|err| (err, copy)));
            }
        }

        // Missing data
        None
    }
}

const NUMBER_OF_HEADER_BYTES: usize = 17;

// https://winprotocoldocs-bhdugrdyduf5h2e4.b02.azurefd.net/MS-NRBF/%5bMS-NRBF%5d.pdf -> page 37
// 1 Byte RecordTypeEnum -> value must be 0
// 4 Bytes RootId
// 4 Bytes HeaderId
// 4 Bytes MajorVersion -> value must be 1
// 4 Bytes MinorVersion -> value must be 0
fn check_nrbf_headers<'a>(args: &'a Args, possible_packet: &'a [u8]) -> Option<&'a [u8]> {
    let header_bytes = &possible_packet[0..NUMBER_OF_HEADER_BYTES];

    let record_type = header_bytes[0];
    let _root_id = i32_from_bytes(&header_bytes[1..5]);
    let _header_id = i32_from_bytes(&header_bytes[5..9]);
    let major_version = i32_from_bytes(&header_bytes[9..13]);
    let minor_version = i32_from_bytes(&header_bytes[13..17]);

    // RecordTypeEnum in Header must be 0
    if record_type != 0x00 {
        return None;
    }
    // Major Version not 1
    if major_version != 1 {
        return None;
    }
    // Minor Version not 0
    if minor_version != 0 {
        return None;
    }

    // disabled as this was not even worth tracing
    let _ = args;
    // trace!("Header: root_id:{} header_id:{}", root_id, header_id);
    // if args.hexdump_incoming_communication {
    //     hex_log_bytes(header_bytes);
    // }

    let rest_bytes = &possible_packet[NUMBER_OF_HEADER_BYTES..];

    Some(rest_bytes)
}

// 0B0101020203030000 seems to be end of a message, always
fn check_nrbf_termination_bytes(possible_packet: &[u8]) -> bool {
    possible_packet.ends_with(&END_OF_MESSAGE_MARKER_TEMPLATE)
}

/// Decode the message custom action
fn decode_single_nrbf(args: &Args, packet: &[u8]) -> Result<InstructionFromTimingProgram, String> {
    match parse_any_known_command(packet) {
        Err(e) => trace!("Nom parser Error: {}", e.to_string()),
        Ok((_, command)) => return Ok(command),
    }

    if args.hexdump_incoming_communication {
        debug!("No command could be parsed from the following:");
        text_log_bytes(packet);
    }

    Err("No matching command could be parsed".into())
}

fn i32_from_bytes(bytes: &[u8]) -> i32 {
    return i32::from_le_bytes(bytes.try_into().unwrap_or([0x00, 0x00, 0x00, 0x00]));
}

fn leb128_u32(input: &[u8]) -> IResult<&[u8], u32> {
    let mut result: u32 = 0;
    let mut shift = 0;
    let mut consumed = 0;

    for &byte in input.iter() {
        let value = (byte & 0x7F) as u32;
        result |= value << shift;
        consumed += 1;

        if byte & 0x80 == 0 {
            // MSB not set → last byte
            return Ok((&input[consumed..], result));
        }

        shift += 7;

        // u32 can only be up to 32 bits → max 5 bytes
        if shift >= 32 {
            return Err(NomFailure(NomError::new(
                input,
                nom::error::ErrorKind::TooLarge,
            )));
        }
    }

    Err(nom::Err::Incomplete(nom::Needed::new(1)))
}

fn parse_failing_command(input: &[u8]) -> IResult<&[u8], InstructionFromTimingProgram> {
    Err(NomErr(NomError::new(input, NomErrorKind::Tag))) // test, this can never be parsed
}

